import React from 'react';
import 'bootstrap/dist/css/bootstrap.min.css';
import githubLogo from './images/github-mark.png';
import linkedinLogo from './images/LI-In-Bug.png';
import { Link } from 'react-scroll';
import './NavBar.css';

const NavBar = () => {
  return (
    <div className="NavBar">
      <div id="navbar">
        <div id="navLeft">
          <h4 id="navName">Roshan Gokul</h4>
        </div>
        <div id="navRight">
          <a className="navButton" href="#experience">Experience</a>
          <a className="navButton" href="#projects">Projects</a>
          <a className="navButton" href="https://github.com/roshangokul">
            <img src={githubLogo} alt="GitHub" />
          </a>
          <a className="navButton" href="https://www.linkedin.com/in/roshangokul/">
            <img src={linkedinLogo} alt="LinkedIn" />
          </a>
        </div>
      </div>
    </div>
  );
}

export default NavBar;
